import React from "react";
import { Button, BlogItem, Gap } from "../../components";
import "./Home.scss";

const Home = () => {
  return (
    <div className="home-page-wrapper">
      <div className="create-wrapper">
        <Button title="create blog" />
      </div>
      <Gap height={40} />
      <div className="content-wrapper">
        <BlogItem />
        <BlogItem />
        <BlogItem />
        <BlogItem />
      </div>
      <p>Pagination</p>
    </div>
  );
};

export default Home;
